When using the `ytdl-core` library in Node.js to download a YouTube video and you want to limit the file size to 25 MB, you need to customize the video quality settings, particularly the bitrate. Here's an example:

```javascript
const ytdl = require('ytdl-core');
const fs = require('fs');

const videoUrl = 'https://www.youtube.com/watch?v=your_video_id';

// You can choose the quality and format you want
const options = {
  quality: 'lowest', // You may need to adjust this based on your preferences
  filter: 'audioandvideo',
};

// Create a write stream to save the video
const videoStream = fs.createWriteStream('video.mp4');

// Download the video with custom bitrate
ytdl(videoUrl, options)
  .on('info', (info) => {
    // Calculate the approximate duration of the video
    const durationInSeconds = info.length_seconds;
    console.log(`Video duration: ${durationInSeconds} seconds`);

    // Set a target bitrate to achieve the desired file size
    const targetFileSizeMB = 25;
    const targetBitrateKbps = (targetFileSizeMB * 8 * 1024) / (durationInSeconds);

    // Update options with custom bitrate
    options.quality = {
      video: {
        bitrate: targetBitrateKbps,
      },
    };
  })
  .pipe(videoStream)
  .on('finish', () => {
    console.log('Video downloaded successfully!');
  })
  .on('error', (error) => {
    console.error(`Error downloading video: ${error.message}`);
  });
```

This example dynamically adjusts the video quality settings based on the desired file size. Note that setting the quality to 'lowest' doesn't guarantee a specific resolution or bitrate, so you may need to experiment with different options to find the right balance between quality and file size for your specific video. Adjust the `targetFileSizeMB` value if you need to meet a different file size constraint.

