async function translateAPI(text, lang) {
    try {
        const response = await axios.get(`https://translate.googleapis.com/translate_a/single?client=gtx&sl=auto&tl=${lang}&dt=t&q=${encodeURIComponent(text)}`);

        if (response.data && response.data[1] && response.data[1][0] && response.data[1][0][0]) {
            return response.data[1][0][0];
        } else {
            console.error('Invalid response structure from Google Translate API:', response.data);
            throw new Error('Invalid response structure');
        }
    } catch (error) {
        console.error('Error in translateAPI:', error);
        throw new Error('Translation error');
    }
}
